  //   // console.log(this.props.match.params.id);
  // };

  // onError = () => {
  //   console.log("boo boo");
  // };
  componentDidMount() {
    debugger;
    // console.log(this.props.data);

    myProjectService
      .getYogaArticles()
      .then(this.onSuccess)
      .catch(this.onError);
  }

  onSuccess = resp => {
    console.log("successs get articles");
    console.log(resp.data.items);
    this.setState({
      yogaArticles: resp.data.items
    });
    // console.log(this.state.horoscopes[2]);
  };

  onError = () => {
    console.log("Error on get articles");
  };

  mapArticles = articles => {
    // let astro = this.state.horoscopes;
    console.log("articles", articles);
    return (
      <React.Fragment>
        {/* <Col lg={12}> */}
        {/* <div className="mr-auto   text-center">
            <img src={articles.image} alt="..." />
          </div>
          <div className="mr-auto   text-center"> {articles.title} </div>
          <div className="mr-auto   text-center"> {articles.exerpt}</div>
          <div className="mr-auto   text-center"> {articles.link}</div> */}

        {/* <CardAuthor
          avatar={articles.image}
          avatarAlt="..."
          title={articles.title}
        /> */}
        <Row>
          <div className="mr-auto   text-center">
            <img src={articles.image} alt="..." />
          </div>
          <p className="description text-center">{articles.title}</p>
          <p className="description text-center">{articles.exerpt}</p>
          <p className="description text-center">{articles.link}</p>
        </Row>
        {/* </Col> */}
      </React.Fragment>
    );
  };

  render() {
    const articleList = this.state.yogaArticles.map(this.mapArticles);
    return (
      <React.Fragment>
        <div className="content">
          {/* <Row> */}
          <Col md={12}>
            <Card className="card-user">
              <CardBody>{articleList}</CardBody>
            </Card>
          </Col>
          {/* </Row> */}
        </div>
      </React.Fragment>
    );
  }
}

export default Articles;
